const SingleSongcard = ()=> {
    return <div className="flex bg-white">
        <div className="w-12 h-12 bg-cover bg-center "
        style={{backgroundImage:`url("https://lastfm.freetls.fastly.net/i/u/ar0/f18cb918fb193137f8f98e01f9f7de2f.jpg")`}}
        >

        </div>

        <div className="text-white flex items-center justify-center flex-col pl-4">
            <div>Curtains</div>
            <div className="text-gray-400 text-xs">Ed Sheeran</div>
        </div>
    </div>

}


export default SingleSongcard;
